// src/workers/stockfish.worker.js

// Load Stockfish from the local public folder.
importScripts('/stockfish/stockfish-nnue-16.min.js');

// The loaded file should define a global function STOCKFISH.
const engine = STOCKFISH();

engine.onmessage = function(event) {
  // Relay Stockfish output back to the main thread.
  postMessage(event.data);
};

onmessage = function(event) {
  // Forward any command from the main thread to Stockfish.
  engine.postMessage(event.data);
};
